CREATE TABLE m_card_active_skill(
  card_master_id INTEGER NOT NULL,
  skill_level INTEGER NOT NULL,
  name TEXT NOT NULL,
  active_skill_master_id INTEGER NOT NULL,
  PRIMARY KEY (card_master_id, skill_level),
  FOREIGN KEY (card_master_id) REFERENCES m_card(id),
  FOREIGN KEY (active_skill_master_id) REFERENCES m_active_skill(id)
);
